import React, { Fragment, useEffect, useState } from 'react';
import { LaunchDarklyApi } from '../launchdarkly/LaunchDarklyApi';
import { LaunchDarkly } from '../launchdarkly/LaunchDarkly';

function HomePage() {

    const [ldItems, setLdItems] = useState<LaunchDarkly>();

    useEffect(() => {
        async function loadProjects() {
            try {
                const data = await LaunchDarklyApi.get('default', 'test');
                console.log('data ne', data.items);
                setLdItems(new LaunchDarkly(data));
            } catch (e) {
                if (e instanceof Error) {
                    console.log(e.message);
                }
            }
        }
        loadProjects();
    }, []);

    function handleToggle(event: any): void {
        setLdItems(new LaunchDarkly({}));
    }

    return (
        <Fragment>
            <div className="App">
                <table>
                    <tr>
                        <th>Flag Name</th>
                        <th>Status</th>
                        <th>Description</th>
                    </tr>
                    {ldItems?.items?.map((item) =>
                        <tr>
                            <td>{item.name}</td>
                            <td>
                                <input type="checkbox" name={item.name} id={item.name} checked={item.environments.test.on} onChange={handleToggle}/>
                            </td>
                            <td>{item.description}</td>
                        </tr>
                    )}
                </table>
            </div>

        </Fragment>
    );
}

export default HomePage;
